fn test_valid_claim_with_nullifier() {
    let treasure_seed: Field = 12345;
    let player_secret: Field = 0xdeadbeef;

    // Safety: test-only unconstrained helper to find treasure
    let (x, y) = unsafe { find_treasure_cell(treasure_seed) };
